import React from 'react';
import './Form.css';

const Form = () => (
    <main>
        <div className="block-form">
            <h2>Cadastro</h2>
            <form action="">
                <span className="title-span">Seu nome</span>
                <input type="text" className="form-control" placeholder="Digite aqui seu nome" />

                <span className="title-span">Seu email</span>
                <input type="text" className="form-control" placeholder="Digite seu melhor email" />


                <button type="submit" className="btn">Salvar</button>
            </form>
        </div>
    </main>
);

export default Form;
